        @Override
	public int compareTo(Concepto o) {
		Concepto concepto = (Concepto)o;
		int x = 0;
		if(this.nombre.toUpperCase().compareTo(concepto.nombre.toUpperCase()) < 0){
			x = -1;
		}
		if(this.nombre.toUpperCase().compareTo(concepto.nombre.toUpperCase()) == 0){
			x = 0;
		}
		if(this.nombre.toUpperCase().compareTo(concepto.nombre.toUpperCase()) > 0){
			x = 1;
		}
		return x;
	}

